INSERT INTO `website` (`id`, `about`, `terms`, `policy`, `status`) VALUES
(1, '<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\"><p>ABOUT US</p><p><br></p><p>Georgie Auto Parts and Accessories Limited a.k.a GAPA NAIJA is a technology-driven eCommerce company improving the way car owners and auto service providers shop for the parts they need.</p><p>GAPA NAIJA is an automotive and truck spare parts merchant company with its headquarters located in Abuja, Nigeria. We stock the best brands in the automotive industry from reputable manufacturers worldwide. At GAPA, we hold a wide range in our catalogs for you to choose from with a user-friendly online and in-store sales platform that can be delivered to your doorsteps</p><p>Why Choose Us?</p><p> We offer a wide range of original spare parts specifically tailored to your automotive requirements. </p><p>Our Service.</p><p> Providing original &amp; specific vehicle spare parts and accessories.</p><p><em>Get the latest updates from @GapaAutoParts.Com, make sure you\'re following us on social media!</em></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>', '<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\"><p><strong>TERMS AND CONDITIONS FOR ALL ORDERS</strong></p><p>By clicking \"Sign Up\", you agree to Georgie Auto Parts &amp; Accessories (GAPA Naija) Terms of Use and Privacy Policy. You consent to receive phone calls and SMS messages from GAPA Naija to provide updates on your order and/or for marketing purposes. Message frequency depends on your activity. You may opt out by texting \"STOP\" to 86753. Message and data rates may apply.</p><p> </p><p> </p><p><strong><u>Conditions of Sale, Payment, and Delivery</u></strong></p><p><strong>1.Provider and Contractual Partner</strong></p><p>Your contractual partner for all orders on our website is</p><p> GEORGIE AUTO PARTS &amp; ACCESSORIES LTD (GAPA NAIJA)</p><p> 5 O. P. Fingesi Street, Utako District</p><p> F.C.T Abuja</p><p> E-mail: <a href=\"mailto:contact@gapaautoparts.com\" target=\"_blank\">contact@gapaautoparts.com</a></p><p> Website: <a href=\"http://www.gapaautoparts.com/\" target=\"_blank\">www.gapaautoparts.com</a></p><p> Company Number: <a href=\"tel:+234 708 888 5242\" target=\"_blank\">+234 708 888 5242</a>.</p><p><br></p><p><strong>2.&nbsp;&nbsp;&nbsp;&nbsp;Scope and Subject Matter of the Contract</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The following general terms and conditions (GTC) apply to account registration and all purchases of goods by the customer (you) via the online shop (www.gapaautoparts.com),( GAPA NAIJA) mobile application, and in-store.</p><p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;These terms and conditions exclusively regulate the contractual relationship between you and us. Your terms and conditions will not become part of the contract even if we do not expressly contradict their inclusion.</p><p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The general terms and conditions are available at any time at www.gapaautoparts.com and be printed out or downloaded.</p><p>&nbsp;</p><p><strong>3.&nbsp;&nbsp;&nbsp;&nbsp;Account Registration &amp; Eligibility</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Account registration is required for purchases from the online shop and mobile application. This can be done as part of the ordering process, but also independently of an order. Once you have registered, an account will be created for you so that you can independently manage your customer data, such as delivery address etc..</p><p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Registration is not limited to individuals and cooperate bodies. </p><p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;When registering your account on the GAPA NAIJA website or mobile application, you have to provide your name (first name and surname), your telephone number, and your e-mail address and choose a password (hereinafter referred to as \"access data\").</p><p>d.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Accessing, browsing, or otherwise submitting an account registration on the site indicates your agreement to all the terms and conditions in this agreement, so please read this agreement carefully before proceeding.</p><p>e.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;After submitting the completed registration form, our support team will send you a welcome e-mail containing your verification token to enable us to complete an e-mail verification process and account registration.</p><p>f.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;You are responsible for ensuring that the information you provide us when registering is true and complete. If you provide incorrect or incomplete information, we are entitled to terminate and delete your account without notice. If incomplete or incorrect information has been submitted, you can choose to notify us immediately for assistance.</p><p>g.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;An account can be terminated in accordance with Nigerian Data Protection Regulations. Your personal data will then be deleted immediately unless we are allowed or required to continue to store them due to legal regulations. Further details can be found in our Privacy declaration.</p><p>h.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;You are under no circumstances required to transfer your access data and your access password to third parties. Should third parties nevertheless gain access to your account or you have other indications of misuse of your account, you must inform us immediately and change your access data.</p><p>i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;There is no entitlement to registration and participation in our online shop or mobile application. You are not authorized to register more than one account on the GAPA NAIJA website or mobile application platforms.</p><p>j.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The use of the GAPA NAIJA shopping platforms is available only to persons who can form legally binding contracts under Nigerian governing laws. In case you are a minor i.e. under the age of 18 years, you shall not register as a customer on GAPA NAIJA and shall not transact or use our shopping platforms. As a minor, if you wish to use or transact on GAPA NAIJA shopping platforms, such use or transaction may be made by your legal guardian or parent who is a registered user of GAPA NAIJA. We reserve the right to terminate your membership and refuse to provide you access or any service available on our platforms, if It is brought to our notice or if it is discovered that you are under the age of 18 years.</p><p><br></p><p><strong>4. Conclusion of a Sales Contract</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The conclusion of a transaction for the purchase of a product takes place as follows: </p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;In order to initiate the ordering process, you must first place the desired product in the shopping cart by clicking the ADD TO CART button.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The entire content of your order will be displayed in the CART at the top right hand of your screen. Before placing an order for the content in the shopping cart, you can view or change your order accordingly. Your orders will be saved by us after the conclusion of the transaction, but you will no longer be able to access them or make changes after the order process has been completed. Please check your order carefully before clicking the \"Buy Now\" button.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;iii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Changes to an order are possible before it leaves our warehouse or is picked up for shipping. Your statutory warranty rights and the right of withdrawal are not affected.</p><p>&nbsp;</p><p><strong>5. Payment</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;When confirming your order, a pop-up of the total cost of items purchased will be shown on your screen for your review, confirmation, or cancellation. </p><p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;For payment processing, you will be redirected to a third-party payment provider, where you will choose your payment option and complete payment/transaction accordingly.</p><p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once we receive a confirmation of your payment, we will send you a receipt confirming your order and shipping detail by e-mail.</p><p>d.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;While using any of the payment method(s) offered at GAPA NAIJA, we will not be responsible or&nbsp;&nbsp;assume any liability, whatsoever in respect of any loss or damage arising directly or indirectly to you due to:</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;i.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Lack of authorization for any transaction(s), or</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Exceeding the preset limit mutually agreed by you and between your \"Bank(s)\", or</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;iii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Any payment issues arising out of the transaction, or</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;iv.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Decline of transaction for any other reason/s. </p><p>&nbsp;</p><p><strong>6. Return Policy</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;All items or goods ordered are thoroughly inspected before shipment to ensure the quality of goods is certified.</p><p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Please ensure are ordering the right product.</p><p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;If there is any defect(s)/damage on returned part(s), the customer will be notified, and no refund of the payment will be issued. </p><p><br></p><p><strong>7. Termination of Service</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GAPA NAIJA reserves the absolute right to modify, discontinue, temporarily or permanently, all portions of our goods and services with or without prior communications. You hereby consent that gapaautoparts.com will under no circumstance be liable to you or any third party for any modification or discontinuance of the availability of goods or services on the website.</p><p><br></p><p><strong>8. Cancellation of an Order</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GAPA NAIJA reserves the right to cancel any order without any explanation or reasons provided if in any situation GAPA NAIJA is not able to meet the requirement of the order placed or order so placed/canceled, or the order does not comply with our policy. However, we will ensure that any reason for the cancellation of an order is communicated within the appropriate time to the concerned person and any applicable refund will be made in a reasonable time.</p><p><br></p><p><strong>&nbsp;9. Product Description</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;GAPA NAIJA presents all products and product descriptions on our platforms as accurately as possible. However, if a product offered on GAPA NAIJA is not as described, you should contact our support team immediately. Otherwise, the product should be returned in unused condition.</p><p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Product information/description/availability is clearly displayed on the product page of the website.</p><p>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;You should ensure the description matches the product you intend to purchase. You can also contact our dedicated support team for support before you make a purchase. We will not be responsible for any liability resulting from the mismatched product.</p><p><br></p><p><strong>10. Risk of Loss</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;All items purchased from GAPA NAIJA are made pursuant to a shipment contract. This means that the Risk of Loss shall remain with GAPA NAIJA until the item is transferred to you. In the event that the items are damaged after receipt, the risk falls on the customer.</p><p><br></p><p><strong>11. Copyright Complaint</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;We at GAPA NAIJA respect the intellectual property of others. In case you feel that your work has been copied in a way that constitutes copyright infringement you can send an e-mail to our support team.</p><p><br></p><p><strong>12. Trademark, Copyright, and Restriction</strong></p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;This site is controlled and operated by Georgie Auto Parts &amp; Accessories Ltd (GAPA NAIJA). All material on this site is protected by copyrights, trademarks, and other intellectual property rights that are owned and controlled by us or by other parties that have licensed their material to us</p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>', '<div class=\"ql-editor\" data-gramm=\"false\" contenteditable=\"true\"><p><strong>Privacy &amp; Cookie Notice</strong></p><p><br></p><p><strong> </strong>1. <strong>About this Notice</strong></p><p><br></p><p> This Privacy and Cookie Notice provides information on how&nbsp;<strong>Georgie Auto Parts &amp; Accessories</strong>&nbsp;<strong>(GAPA NAIJA)</strong> collects and processes your personal data when you visit our customer-facing operations (website, mobile applications, and sales outlets). We place great importance on your privacy and are committed to safeguarding it to ensure you have a worry-free customer experience and confidence in our brand.&nbsp;</p><p>&nbsp;</p><p> 2. <strong>The Data We Collect About You?</strong></p><p><br></p><p> We collect your personal data in order to provide and continually improve our products and services. We may collect, use, store and transfer the following different kinds of personal data about you for marketing and personal data optimization purposes.&nbsp;<strong>Georgie Auto Parts &amp; Accessories</strong>&nbsp;(GAPA NAIJA) also uses Google Digital Marketing to propose targeted offers.</p><p> To find out more:</p><ul><li><strong>Information you provide to us</strong>: We receive and store the information you provide to us including your identity data, contact data, delivery address, and financial data.</li><li><strong>Information on your use of our website and/or mobile applications</strong>: We automatically collect and store certain types of information regarding your use of the Gapa Naija marketplace including information about your searches, views, downloads, and purchases.</li><li><strong>Information from third parties and publicly available sources</strong>: We may receive information about you from third parties including our carriers; payment service providers; merchants/brands; and advertising service providers.</li></ul><p><br></p><p>3. <strong>Cookies and How We Use Them</strong></p><p><br></p><p> A cookie is a small file of letters and numbers that we put on your computer if you agree.</p><p> Cookies allow us to distinguish you from other users of our website and mobile applications, which helps us to provide you with an enhanced browsing experience. For example, we use cookies for the following purposes:</p><ul><li>Recognising and counting the number of visitors and seeing how visitors move around the site when they are using it (this helps us to improve the way our website works, for example by ensuring that users can find what they are looking for faster).</li><li>Identifying your preferences and subscriptions e.g. language settings, saved items, items stored in your basket&nbsp;My Cart and Business Account portal; and</li><li>Sending you newsletters and commercial/advertising messages tailored to your interests.</li></ul><p>Our approved third parties may also set cookies when you visit our marketplace. Third parties include search engines, providers of measurement and analytics services, social media networks, and advertising companies.</p><p>&nbsp;</p><p> 4<strong>. How We Use Your Personal Data</strong></p><p><br></p><p> We use your personal data to operate, provide, develop and improve the products and services that we offer, including the following:</p><ul><li>Registering you as a new customer.</li><li>Processing and delivering your orders.</li><li>Managing your relationship with us.</li><li>Enabling you to participate in promotions, competitions, and surveys.</li><li>Improving our website, applications, products, and services</li><li>Recommending/advertising products or services which may be of interest to you.</li><li>Complying with our legal obligations, including verifying your identity where necessary.</li><li>Detecting fraud.</li><li>Maintain communication with you (via phone, email, contact form, etc.)</li></ul><p>5. <strong>How We Share Your Personal Data</strong></p><p><br></p><p> We may need to share your personal data with third parties for the following purposes:</p><ul><li>Sale of products and services: In order to deliver your products and services purchased on our marketplace from third parties, we may be required to provide your personal data to such third parties.</li><li>Working with third-party service providers: We engage third parties to perform certain functions on our behalf. Examples include fulfilling orders for products or services, delivering packages, analyzing data, providing marketing assistance, processing payments, transmitting content, assessing and managing credit risk, and providing customer service.</li><li>Business transfers: As we continue to develop our business, we might sell or buy other businesses or services. In such transactions, customer information may be transferred together with other business assets.</li><li>Detecting fraud and abuse: We release accounts and other personal data to other companies and organizations for fraud protection and credit risk reduction, and to comply with the law.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p> When we share your personal data with third parties:</p><ul><li>We require them to agree to use your data in accordance with the terms provided by our Privacy and Cookie Notice (Privacy Policy) and in accordance with the law.</li><li>We only permit the third party to process your personal data for specified purposes and in accordance with our instructions. We do not allow our third-party service providers to use your personal data for their own purposes.</li></ul><p>6. <strong>International Transfers</strong></p><p><br></p><p> We may transfer your personal data to locations in another country if this is permissible pursuant to applicable laws in your location and you have given express consent. There are inherent risks in such transfers.</p><p> In the event of international transfers of your personal data, we shall put in place measures necessary to protect your data, and we shall continue to respect your legal rights pursuant to the terms of this Privacy and Cookie Notice and applicable laws in your location.</p><p>&nbsp;</p><p> 7. <strong>Data Security</strong></p><p><br></p><p> We have put in place appropriate security measures to prevent your personal data from being accidentally lost, used, or accessed in an unauthorized way, altered, or disclosed.</p><p> In addition, we limit access to your personal data to those employees, agents, contractors, and other third parties who have a business need to know or permission to access such data. They will only process your personal data on our instructions and they are subject to a duty of confidentiality.</p><p> We have put in place procedures and checks to deal with any suspected personal data breach and will notify you and any applicable regulator of a breach where we are legally required to do so.</p><p>&nbsp;</p><p> 8. <strong>Your Legal Rights</strong></p><p><br></p><p> It is important that the personal data we hold about you is accurate and current. Please keep us informed if your personal data changes or any inaccuracy is noticed during your relationship with us.</p><p> Under certain circumstances, you have rights under data protection laws in relation to your personal data, including the right to access, correct or erase your personal data, object to or restrict processing of your personal data, and unsubscribe from our emails and newsletters.</p><p>&nbsp;</p><p> 9. <strong>Further Details</strong></p><p><br></p><p><strong> </strong>If you are looking for more information on how we process your personal data, or you wish to exercise your legal rights in respect of your personal data, please send us an email via&nbsp;<strong>contact@gapaautoparts.com.</strong></p></div><div class=\"ql-clipboard\" contenteditable=\"true\" tabindex=\"-1\"></div><div class=\"ql-tooltip ql-hidden\"><a class=\"ql-preview\" target=\"_blank\" href=\"about:blank\"></a><input type=\"text\" data-formula=\"e=mc^2\" data-link=\"https://quilljs.com\" data-video=\"Embed URL\"><a class=\"ql-action\"></a><a class=\"ql-remove\"></a></div>', '0');
